import React from 'react';

function FileDetails({ file, onClose }) {
  return (
    <div className="absolute top-0 left-0 w-full h-full bg-gray-900 bg-opacity-50 flex items-center justify-center">
      <div className="bg-white p-5 rounded-lg">
        <h2 className="text-xl font-bold">{file.name}</h2>
        <p>Path: {file.path}</p>
        {/* Add more details as needed */}
        <button onClick={onClose} className="mt-4 bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded">
          Close
        </button>
      </div>
    </div>
  );
}

export default FileDetails;
